import React from "react";
import "../styles/Profile.css";

function Profile(isAuth) {
    const username = "Ivan";
    return (
        <div className="profile">
            <strong>Ivan</strong>
            <strong style={{color: "#999"}}>user/{username}</strong>
            <div className="settings">
                <a className="settings-button" href={"/user/"+username+"/settings"}>
                    Настройки
                </a>
            </div>
            <div className="profile-info">
                <text>Роль: пользователь</text>
                <text>Жалобы: 2</text>
                <text>Добавлено в избранное: 10</text>
                <text>Последняя дата разблокировки: 17.11.2022</text>
            </div>
            <div className="post-joke">
                <a className="post-joke-button" href={"/user/"+username+"/create_joke"}>
                    Создать шутку
                </a>
            </div>
        </div>
    );
}

export default Profile;
